 Here is a simple implementation of a sorting algorithm called bubble sort, which can be used to sort an array of strings in alphabetical order:
```
function bubbleSortStrings(arr) {
  let swapped = true;

  while (swapped) {
    swapped = false;

    for (let i = 0; i < arr.length - 1; i++) {
      if (arr[i].localeCompare(arr[i+1]) > 0) {
        let temp = arr[i];
        arr[i] = arr[i+1];
        arr[i+1] = temp;
        swapped = true;
      }
    }
  }

  return arr;
}
```

